ControlPropertyState.AutoRuleBindingString:
// 1. Salva o cache local ANTES da sincronização (precaução extra)
Concurrent(
    SaveData(colDadosOffline, "CacheDadosOffline"),
    SaveData(colDadosLista, "CacheDadosLista"),
    SaveData(colComparacaoLista, "CacheListaComparacao")
);

// 2. Limpa coleções temporárias de itens sincronizados/erros
Clear(colItensSincronizados);
Clear(colItensErroSync);

// 3. Sincroniza até 20 pendentes por vez, SE houver algum
If(
    CountRows(Filter(colDadosOffline, StatusSync = "PENDENTE" || StatusSync = "ERRO")) = 0,
    Notify("Nenhum item pendente para sincronizar!", NotificationType.Information)
,
    ForAll(
        FirstN(Filter(colDadosOffline, StatusSync = "PENDENTE"), 100) As item,
        If(
            Connection.Connected,
            IfError(
                If(
                    IsBlank(LookUp('Lista Teste - APP Offline', ID_Referencia = item.ID_Referencia)),
                    // Criar novo registro
                    With(
                        {
                            registroNovo: Patch(
                                'Lista Teste - APP Offline',
                                Defaults('Lista Teste - APP Offline'),
                                DropColumns(item, IndiceLote, StatusSync, MensagemSync, DataCriacao)
                            )
                        },
                        Patch(
                            'Lista Teste - APP Offline',
                            registroNovo,
                            {linha: registroNovo.ID}
                        );
                        Patch(
                            colDadosOffline,
                            LookUp(colDadosOffline, ID_Referencia = item.ID_Referencia),
                            { StatusSync: "ENVIADO", MensagemSync: "Enviado com sucesso", linha: registroNovo.ID }
                        );
                        Collect(
                            colItensSincronizados,
                            {
                                ID_Referencia: item.ID_Referencia,
                                linha: registroNovo.ID
                            }
                        )
                    ),
                    // Já existe: atualizar
                    With(
                        {
                            registroExistente: LookUp('Lista Teste - APP Offline', ID_Referencia = item.ID_Referencia)
                        },
                        Patch(
                            'Lista Teste - APP Offline',
                            registroExistente,
                            DropColumns(item, IndiceLote, StatusSync, MensagemSync, DataCriacao), {linha: registroExistente.ID}
                        );
                        Patch(
                            colDadosOffline,
                            LookUp(colDadosOffline, ID_Referencia = item.ID_Referencia),
                            { StatusSync: "ENVIADO", MensagemSync: "Atualizado com sucesso", linha: registroExistente.ID }
                        );
                        Collect(
                            colItensSincronizados,
                            {
                                ID_Referencia: item.ID_Referencia,
                                linha: registroExistente.ID
                            }
                        )
                    )
                ),
                // Em caso de erro:
                Patch(
                    colDadosOffline,
                    LookUp(colDadosOffline, ID_Referencia = item.ID_Referencia),
                    { StatusSync: "ERRO", MensagemSync: "Falha ao sincronizar. Revise dados obrigatórios ou conexão." }
                );
                Collect(
                    colItensErroSync,
                    {
                        ID_Referencia: item.ID_Referencia,
                        MensagemSync: "Falha ao sincronizar. Revise dados obrigatórios ou conexão."
                    }
                )
            )
        )
    );
    
    // Notificações de sucesso/erro após o ForAll
    If(
        CountRows(colItensSincronizados) > 0,
            Notify("Sincronização finalizada! " & CountRows(colItensSincronizados) & " item(ns) enviados/atualizados no SharePoint.", NotificationType.Success)
        ,
        If(
            CountRows(colItensErroSync) > 0,
                Notify("Alguns registros apresentaram erro e não foram enviados. Revise a lista de pendentes.", NotificationType.Error)
            ,
                Notify("Nenhum item foi sincronizado! Verifique se há dados pendentes.", NotificationType.Warning)
        )
    )
);

// Carrega lista principal do SharePoint em lotes
Set(VarLote, 1000);
Set(PrimeiraLinha, First(SortByColumns('Lista Teste - APP Offline', "linha", SortOrder.Ascending)).linha);
Set(UltimaLinha, First(SortByColumns('Lista Teste - APP Offline', "linha", SortOrder.Descending)).linha);
Set(QtdLotes, RoundUp((UltimaLinha - PrimeiraLinha + 1) / VarLote, 0));
ClearCollect(SeqLotes, Sequence(QtdLotes, 0));
ClearCollect(colDadosLista, Filter('Lista Teste - APP Offline', false));

ForAll(
    SeqLotes As item,
    With(
        {
            limInf: item.Value * VarLote + PrimeiraLinha,
            limSup: (item.Value + 1) * VarLote + PrimeiraLinha - 1
        },
        Collect(
            colDadosLista,
            Filter(
                'Lista Teste - APP Offline',
                linha >= limInf && linha <= limSup
            )
        )
    )
);
SaveData(colDadosLista, "CacheDadosLista");

// 4. REMOVE do cache TODOS os ENVIADO e DUPLICADO, sempre!
RemoveIf(colDadosOffline, StatusSync = "ENVIADO" || StatusSync = "DUPLICADO");
SaveData(colDadosOffline, "CacheDadosOffline");

// 5. Salva os caches principais novamente, se necessário
Concurrent(
    SaveData(colDadosOffline, "CacheDadosOffline"),
    SaveData(colDadosLista, "CacheDadosLista"),
    SaveData(colComparacaoLista, "CacheListaComparacao")
);

// Calcula o último índice do lote offline
Set(varUltimoIndiceLote, 
    If(
        CountRows(colDadosOffline) > 0,
        Max(colDadosOffline, IndiceLote),
        0
    )
);

// Para cada número de 1 a 20, cria um registro de teste único e sequencial
ForAll(
    Sequence(100) As itemSeq,
    With(
        {
            novoRegistro: Patch(
                Form1.Updates,
                {
                    ID_Referencia: Upper(GUID()),
                    IndiceLote: varUltimoIndiceLote + itemSeq.Value,
                    StatusSync: "PENDENTE",
                    MensagemSync: "",
                    DataCriacao: Date(Year(Now()), Month(Now()), Day(Now()))
                }
            )
        },
        // Verifica duplicidade e adiciona ao offline, ou marca como duplicado
        If(
            IsBlank(LookUp(colComparacaoLista, ID_Referencia = novoRegistro.ID_Referencia)),
                Collect(colDadosOffline, novoRegistro);
                Collect(colComparacaoLista, {ID_Referencia: novoRegistro.ID_Referencia})
            ,
                Patch(
                    colDadosOffline,
                    LookUp(colDadosOffline, ID_Referencia = novoRegistro.ID_Referencia),
                    { StatusSync: "DUPLICADO", MensagemSync: "Já existe no SharePoint." }
                )
        )
    )
);

// Salva as collections modificadas
SaveData(colDadosOffline, "CacheDadosOffline");
SaveData(colComparacaoLista, "CacheListaComparacao");

// Limpa e reseta o formulário e o ComboBox
ResetForm(Form1);
Reset(ComboBox1);

// Atualiza a variável GUID
Set(VarGUID, Upper(GUID()));

// Se estiver online, já sincroniza automaticamente
If(
    Connection.Connected,
        Select(btn_sinc);
        Notify("Registros de teste salvos e sincronizados automaticamente!", NotificationType.Success)
    ,
        Notify("Registros de teste salvos localmente! Sincronize depois para enviar ao SharePoint.", NotificationType.Information)
)
